import * as React from 'react';
import wrapIcon from '../utils/wrapIcon';
const rawSvg = (iconProps) => {
    const { className, primaryFill } = iconProps;
    return React.createElement("svg", { width: 16, height: 16, viewBox: "0 0 16 16", xmlns: "http://www.w3.org/2000/svg", className: className },
        React.createElement("path", { d: "M4.5 2A2.5 2.5 0 002 4.5v7A2.5 2.5 0 004.5 14h1.76A5.5 5.5 0 0114 6.26V4.5A2.5 2.5 0 0011.5 2h-7zm6 13a4.5 4.5 0 100-9 4.5 4.5 0 000 9zm1.85-6.35c.2.2.2.5 0 .7l-1.14 1.15 1.14 1.15a.5.5 0 01-.7.7l-1.15-1.14-1.15 1.14a.5.5 0 01-.7-.7l1.14-1.15-1.14-1.15a.5.5 0 11.7-.7l1.15 1.14 1.15-1.14c.2-.2.5-.2.7 0z", fill: primaryFill }));
};
const SquareDismiss16Filled = wrapIcon(rawSvg({}), 'SquareDismiss16Filled');
export default SquareDismiss16Filled;
